import React, { useState } from 'react';
import './App.css';
import { Route, Link, BrowserRouter as Router, Switch } from 'react-router-dom'
import Login from './Login';
import GuardedRoute from 'react-guarded-route'
import Navbar from 'react-bootstrap'


const IsUserLogged = (checkIfSignedIn) => {
  let isUserSigned = sessionStorage.getItem('userLoggedIn')
  return checkIfSignedIn ? isUserSigned !== null : isUserSigned === null
}

function App() {
  return (
    <Router>
      <Switch>
        <Navbar bg='dark'>
        <GuardedRoute exact path='/' validatorFunction={IsUserLogged(true)} redirectTo='/login' component={Home} />
        <GuardedRoute path='/about' validatorFunction={IsUserLogged(true)} redirectTo='/login' component={About} />
        <GuardedRoute path='/login' validatorFunction={IsUserLogged(false)} redirectTo='/' component={Login} />
        </Navbar>
      </Switch>
    </Router>
  );
}

function About() {
  return (
    <h1>About</h1>
  )
}

function Home() {
  return (
    <h1>Home</h1>
  )
}

export default App;
